import './carousel.css';


class Carousel extends React.Component{
  render(){

    return(
      <div className=" container">
        <div id="demo" className="carousel slide" data-ride="carousel">
          <CarouselSlide/>
          <CarouselInner/>
      </div>
    </div>
    )
  }
}

export default Carousel
